function drawSunModel(scaleFactor = 200) {
  beginShape(TRIANGLES);
  for (let i = 0; i < sunTris.length; i++) {
    const tri = sunTris[i];
    for (let j = 0; j < 3; j++) {
      const v = tri[j];
      vertex(v[0] * scaleFactor, v[1] * scaleFactor, v[2] * scaleFactor);
    }
  }
  endShape();
}